import React from "react";
import {
  View,
  ScrollView,
  Image,
  StyleSheet,
  TouchableOpacity,
  Text,
 
} from "react-native";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import { Card, Title, Paragraph } from "react-native-paper";
import Rating from "../../components/Rating";
 import DrawerSceneWrapper from "../../components/DrawerSceneWrapper";
import { AntDesign } from "@expo/vector-icons";
import Icon from "react-native-vector-icons/FontAwesome";
import { useNavigation } from "@react-navigation/native";

const Tab = createMaterialTopTabNavigator();

const imageUrls = [
  "https://images.unsplash.com/photo-1635258248953-d0d6fea663b4?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8M3x8YmVhdGlmdWwlMjBtYW58ZW58MHx8MHx8fDA%3D",
  "https://images.unsplash.com/photo-1562071707-7249ab429b2a?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8NHx8YmVhdGlmdWwlMjB3b21lbnxlbnwwfHwwfHx8MA%3D%3D",
  "https://images.unsplash.com/photo-1635257348209-ebc3648f2c7a?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Nnx8YmVhdGlmdWwlMjBtYW58ZW58MHx8MHx8fDA%3D",
  "https://images.unsplash.com/photo-1484399172022-72a90b12e3c1?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MjB8fGJlYXRpZnVsJTIwd29tZW58ZW58MHx8MHx8fDA%3D",
  "https://plus.unsplash.com/premium_photo-1671656349322-41de944d259b?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTN8fGJlYXRpZnVsJTIwbWFufGVufDB8fDB8fHww",
  "https://images.unsplash.com/photo-1579114521211-75312ab43516?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTV8fGJlYXRpZnVsJTIwbWFufGVufDB8fDB8fHww",
  "https://plus.unsplash.com/premium_photo-1689747698547-271d2d553cee?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTd8fGJlYXRpZnVsJTIwbWFufGVufDB8fDB8fHww",
];

const organizationImageUrls = [
  "data:image/png;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSXxOmKTvfFWQIVcbbGbJOo8x7O9af-uOdksA&usqp=CAU",
  "data:image/png;base64,",
  "data:image/png;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdbOs_XmUVZnADXy-Tsu_GlV-1hOeINdN5BA&usqp=CAU",
  "data:image/png;base64,",
  "data:image/png;base64,",
];

const names = [
  "John Doe",
  "Jane Doe",
  "Bob Smith",
  "Alice Johnson",
  "David Lee",
  "Emily Brown",
  "Chris Evans",
];

const organizationNames = [
  "King Pictures",
  "Cactuscat Clothing",
  "Owosso",
  "Affogato Media",
  "Light Moon",
  "TechDecomposed",
  "FioTech",
];

const ProvidersScreen = ({ navigation }) => {
  const { openDrawer } = navigation;
 

  const TouchableCard = ({ imageUrl, name, onPress }) => (
    <TouchableOpacity onPress={onPress}>
      <Card style={styles.card}>
        <View style={styles.calendarIconContainer}>
          <Icon name="calendar" size={12} color="lightgreen" />
        </View>
        <Image style={styles.circleImage} source={{ uri: imageUrl }} />
        <Card.Content style={styles.cardContent}>
          <Title style={{ fontSize: 17 }}>{name}</Title>
          <Paragraph style={{ fontSize: 12 }}>Teacher</Paragraph>
          {/* You can replace the Rating or Give component as needed */}
          <Rating />
        </Card.Content>
      </Card>
    </TouchableOpacity>
  );
  const InstructorsTab = () => {
    const navigation = useNavigation();

    return (
      <ScrollView
        style={styles.tabContainer}
        showsVerticalScrollIndicator={false}
      >
        <View style={styles.cardContainer}>
          {imageUrls.map((url, index) => (
            <TouchableCard
              key={index}
              imageUrl={url}
              name={names[index]}
              onPress={() => {
                navigation.navigate("one"); // Navigate to OverviewScreen
              }}
            />
          ))}
        </View>
      </ScrollView>
    );
  };

  const OrganizationTab = () => (
    <ScrollView
      style={styles.tabContainer}
      showsVerticalScrollIndicator={false}
    >
      <View style={styles.cardContainer}>
        {organizationImageUrls.map((url, index) => (
          <TouchableCard
            key={index}
            imageUrl={url}
            name={organizationNames[index]}
            onPress={() => navigation.navigate("two")}
          />
        ))}
      </View>
    </ScrollView>
  );

  const ConsultantsTab = () => (
    <ScrollView
      style={styles.tabContainer}
      showsVerticalScrollIndicator={false}
    >
      <View style={styles.cardContainer}>
        {imageUrls.map((url, index) => (
          <TouchableCard
            key={index}
            imageUrl={url}
            name={names[index]}
            onPress={() =>navigation.navigate("three")}
          />
        ))}
      </View>
    </ScrollView>
  );

  return (
      <DrawerSceneWrapper>
      <View
        style={{
          flexDirection: "row",
          alignItems: "center",
          backgroundColor: "white",
        }}
      >
        <TouchableOpacity
          onPress={openDrawer}
          style={{ marginLeft: 20, marginTop: 50 }}
        >
          <AntDesign name="menu-fold" size={23} color="black" />
        </TouchableOpacity>
        <Text
          style={{
            fontSize: 22,
            color: "black",
            marginTop: 45,
            marginLeft: 130,
          }}
        >
          Providers
        </Text>
      </View>
   
      <Tab.Navigator
        screenOptions={{
          tabBarStyle: {
            backgroundColor: "white",
           
          },
        }}
      >
        <Tab.Screen name="Instructors(7)" component={InstructorsTab} />
        <Tab.Screen name="Organization(7)" component={OrganizationTab} />
        <Tab.Screen name="Consultants(7)" component={ConsultantsTab} />
      </Tab.Navigator>

     </DrawerSceneWrapper>
  );
};

const styles = StyleSheet.create({
  tabContainer: {
    padding: 8,
    flex:1
  },
  cardContainer: {
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
  },
  card: {
    width: 190,
    marginBottom: 30,
    height: 210,
    marginTop: 10,
  },
  circleImage: {
    width: 80,
    height: 80,
    borderRadius: 40,
    alignSelf: "center",
    marginBottom: 10,
    marginTop: 15,
  },
  cardContent: {
    alignItems: "center",
  },
  calendarIconContainer: {
    position: "absolute",
    top: 10,
    right: 10,
    backgroundColor: "#36AA5F",
    borderRadius: 16,
    padding: 3,
  },
});

export default ProvidersScreen;
